	private static NNet train() throws FileNotFoundException, IOException {
		File trainImages = new File("train-images.idx3-ubyte");
		File trainLabels = new File("train-labels.idx1-ubyte");

		NNet net = null;

		try (FileInputStream trainImgStream = new FileInputStream(trainImages);
				FileInputStream trainLblStream = new FileInputStream(trainLabels)) {

			// magic number
			byte[] buffer = new byte[4];
			trainImgStream.read(buffer);
			int magicNumber = ByteBuffer.wrap(buffer).getInt();
			if (magicNumber != 0x00000803)
				throw new IllegalArgumentException("Invalid Magic number of images file (should be 0x00000803)");

			trainLblStream.read(buffer);
			magicNumber = ByteBuffer.wrap(buffer).getInt();
			if (magicNumber != 0x00000801)
				throw new IllegalArgumentException("Invalid Magic number of images file (should be 0x00000803)");

			// number of images
			trainImgStream.read(buffer);
			int imageCount = 0;
			imageCount |= buffer[0] & 0xFF;
			imageCount <<= 8;
			imageCount |= buffer[1] & 0xFF;
			imageCount <<= 8;
			imageCount |= buffer[2] & 0xFF;
			imageCount <<= 8;
			imageCount |= buffer[3] & 0xFF;

			trainLblStream.read(buffer);
			int labelsCount = 0;
			labelsCount |= buffer[0] & 0xFF;
			labelsCount <<= 8;
			labelsCount |= buffer[1] & 0xFF;
			labelsCount <<= 8;
			labelsCount |= buffer[2] & 0xFF;
			labelsCount <<= 8;
			labelsCount |= buffer[3] & 0xFF;
			if (imageCount != labelsCount)
				throw new IllegalArgumentException("Image count and labels count must be the same");

			if (imageCount != 60000)
				throw new IllegalArgumentException("Image count is expected to be 60000");

			// rows
			trainImgStream.read(buffer);
			int rows = ByteBuffer.wrap(buffer).getInt();

			// cols
			trainImgStream.read(buffer);
			int cols = ByteBuffer.wrap(buffer).getInt();
			System.out.println("Image dimensions: " + rows + "x" + cols);

			int pixels = rows * cols;
			int results = 10;

			int batchSize = 100;
			double sensitivity = 0.8;
			net = new NNet(new int[] { pixels, 64, results }, new Sigmoid(), new DigitSuccessCheck());

			// net.setOutputActivationFunction(new OutputActivationFunction() {
			//
			// @Override
			// public Matrix activatePrime(Matrix potential) {
			// // TODO Auto-generated method stub
			// return null;
			// }
			//
			// @Override
			// public Matrix activate(Matrix potential) {
			// double sum = 0;
			// for (int r = 0; r < potential.getRows(); r++)
			// sum += Math.pow(Math.E, potential.get(r, 0));
			// Matrix result = new Matrix(potential.getRows(), 1);
			// for (int r = 0; r < potential.getRows(); r++)
			// result.set(r, 0, Math.pow(Math.E, potential.get(r, 0)) / sum);
			// return result;
			// }
			// });

			double[][] inputs = new double[imageCount][pixels];
			double[][] outputs = new double[imageCount][results];

			for (int img = 0; img < imageCount; img++) {

				byte[] label = new byte[1];
				trainLblStream.read(label);
				byte[] image = new byte[pixels];
				trainImgStream.read(image);

				for (int r = 0; r < rows; r++) {
					for (int c = 0; c < cols; c++) {
						int i = r * cols + c;
						inputs[img][i] = (image[i] & 0xFF) / 255.0;
					}
				}
				outputs[img][label[0]] = 1;
				System.out.println("Images processed " + (img + 1) + "/" + imageCount);
			}

			boolean fileSwitch = false;
			do {
				double[][] batchInputs = new double[batchSize][pixels];
				double[][] batchOutputs = new double[batchSize][results];
				// aby se instance vybíraly náhodně, ale bylo zajištěno, že se
				// nevyberou vícekrát stejná data, je náhodně pouze zvolen krok,
				// se kterým se budou přeskakovat instance za sebou
				int step = (int) (1 + Math.random() * imageCount / 2);
				System.out.print("Step: " + step + " ");
				for (int b = 0; b < batchSize; b++) {
					int img = (b * step) % imageCount;
					batchInputs[b] = inputs[img];
					batchOutputs[b] = outputs[img];
				}

				net.train(batchInputs, batchOutputs, sensitivity);
				net.writeConfig(new File(fileSwitch ? "target/nnet.json" : "target/nnet2.json"));
				fileSwitch = !fileSwitch;
			} while (net.getSuccessRate() < 99 || net.getError() > 0.1);

		}

		return net;
	}

	public static void test(NNet nnet) throws FileNotFoundException, IOException {

		File testImages = new File("t10k-images.idx3-ubyte");
		File testLabels = new File("t10k-labels.idx1-ubyte");

		try (FileInputStream testImgStream = new FileInputStream(testImages);
				FileInputStream testLblStream = new FileInputStream(testLabels)) {

			// magic number
			byte[] buffer = new byte[4];
			testImgStream.read(buffer);
			int magicNumber = ByteBuffer.wrap(buffer).getInt();
			if (magicNumber != 0x00000803)
				throw new IllegalArgumentException("Invalid Magic number of images file (should be 0x00000803)");

			testLblStream.read(buffer);
			magicNumber = ByteBuffer.wrap(buffer).getInt();
			if (magicNumber != 0x00000801)
				throw new IllegalArgumentException("Invalid Magic number of images file (should be 0x00000803)");

			// number of images
			testImgStream.read(buffer);
			int imageCount = 0;
			imageCount |= buffer[0] & 0xFF;
			imageCount <<= 8;
			imageCount |= buffer[1] & 0xFF;
			imageCount <<= 8;
			imageCount |= buffer[2] & 0xFF;
			imageCount <<= 8;
			imageCount |= buffer[3] & 0xFF;

			testLblStream.read(buffer);
			int labelsCount = 0;
			labelsCount |= buffer[0] & 0xFF;
			labelsCount <<= 8;
			labelsCount |= buffer[1] & 0xFF;
			labelsCount <<= 8;
			labelsCount |= buffer[2] & 0xFF;
			labelsCount <<= 8;
			labelsCount |= buffer[3] & 0xFF;
			if (imageCount != labelsCount)
				throw new IllegalArgumentException("Image count and labels count must be the same");

			if (imageCount != 10000)
				throw new IllegalArgumentException("Image count is expected to be 60000");

			// rows
			testImgStream.read(buffer);
			int rows = ByteBuffer.wrap(buffer).getInt();

			// cols
			testImgStream.read(buffer);
			int cols = ByteBuffer.wrap(buffer).getInt();
			System.out.println("Image dimensions: " + rows + "x" + cols);

			int pixels = rows * cols;
			int results = 10;

			DigitSuccessCheck check = new DigitSuccessCheck();

			double success = 0;

			for (int i = 0; i < imageCount; i++) {

				byte[] label = new byte[1];
				testLblStream.read(label);
				byte[] image = new byte[pixels];
				testImgStream.read(image);

				double[] input = new double[pixels];
				double[] output = new double[results];
				output[label[0]] = 1;
				for (int r = 0; r < rows; r++) {
					for (int c = 0; c < cols; c++) {
						int index = r * cols + c;
						int val = image[index] & 0xFF;
						input[index] = val / 255.0;
						// System.out.print(val + ";");
					}
				}
				// System.out.println();
				// System.out.println(label[0]);

				Matrix guess = nnet.guess(MatrixUtils.fromFlatArray(pixels, 1, input));
				Matrix target = MatrixUtils.fromFlatArray(results, 1, output);
				if (check.isSuccess(target, guess))
					success++;

				int imgId = i + 1;
				System.out.println("Images guessed " + imgId + "/" + imageCount + " success: "
						+ String.format("%.1f", (success / imgId * 100)) + "%");
			}

		}

	}

	public static void main(String[] args) throws IOException {

		NNet nnet = loadNet();
		//NNet nnet = train();

		test(nnet);

	}

